export interface DeviceType {
  id: number;
  name: string;
  slug: string;
  description: string;
  icon: string | null;
  domain: "COMPUTERS" | "PHONES";
}

export interface Brand {
  id: number;
  name: string;
}

export interface Series {
  id: number;
  name: string;
  brand: number; // ID
  device_type: number; // ID
  description: string;
}

export interface ProductModel {
  id: number;
  name: string;
  brand: number; // ID
  series: number; // ID
  is_popular?: boolean; // Optional field indicating if this is a popular model
}

export interface Part {
  id: number;
  name: string;
  ean13: string | null;
  sku: string | null;
  serial_number: string;
  image_url: string;
  price: string;
  repair_price: string;
  special_price: string;
  other_price: string;
  brand: number | null; // ID
  model: number | null; // ID
  created_at: string;
  updated_at: string;
}

import { type Part } from "./part";

export type DeviceType = "smartphone" | "tablet" | "computer" | "other"
export type RepairStatus = "saisie" | "en-cours" | "prete" | "en-attente"
export type DepositStatus = "deposited" | "scheduled"
export type UserRole = "admin" | "manager" | "technician"
export type RepairOutcome = "success" | "failed" | null
export type PaymentMethod = "cash" | "card"
export type PaymentStatus = "unpaid" | "partial" | "paid"

export interface Brand {
  id: string
  name: string
  deviceTypes: DeviceType[]
}

export interface Model {
  id: string
  name: string
  brandId: string
  deviceType: DeviceType
}

export interface Issue {
  id: string
  name: string
  deviceTypes: DeviceType[]
  requiresPart?: boolean
  basePrice: number
  categoryType: 'part_based' | 'service_based'
  associatedPart?: Part
  servicePricing?: ServicePricing[]
}

export interface PartQualityTier {
  id: number;
  part_id: number;
  quality_tier: 'standard' | 'premium' | 'original' | 'refurbished';
  price: number;
  warranty_days: number;
  availability_status: 'in_stock' | 'low_stock' | 'out_of_stock' | 'discontinued';
  description_fr?: string;
  description_en?: string;
}

export interface ServicePricing {
  id: number;
  pricing_type: 'fixed' | 'hourly' | 'tiered';
  base_price: number;
  time_estimate_minutes?: number;
  complexity_level: 'low' | 'medium' | 'high' | 'critical';
  description_fr?: string;
  description_en?: string;
}

export interface RepairIssue {
  id: number;
  issue: Issue;
  issue_id: number;
  quality_tier?: PartQualityTier;
  quality_tier_id?: number;
  custom_price?: number;
  notes?: string;
  get_price: number;
}

export interface Profile {
  id: number;
  type: string;
  phone_number: string;
  address: string;
  date_of_birth: string | null;
  profile_picture: string | null;
}

export interface User {
  id: number; // Mapped from pk or added to serializer
  pk: number;
  username: string;
  email: string;
  first_name: string;
  last_name: string;
  profile: Profile;
}

export interface Client extends User {}

export interface Payment {
  id: string
  amount: number
  method: PaymentMethod
  date: Date
  note?: string
}

export interface Repair {
  id: number;
  uid: string;
  date: string;
  client: User;
  product_model: number | null; // ID of the product model
  description: string;
  password?: string;
  price: string;
